(328, '_transient_tube-yt-vid-dtl-b675ecb4bfd3c31d85b0d92b94110e8b', 'a:1:{i:0;a:13:{s:2:"id";s:11:"BcR_Wg42dv8";s:5:"title";s:51:"Marijuana: Last Week Tonight with John Oliver (HBO)";s:16:"content_original";s:581:"Under federal law, even legal marijuana is illegal. John Oliver explains why conflicting drug laws pose serious problems.\n\nConnect with Last Week Tonight online...\nSubscribe to the Last Week Tonight YouTube channel for more almost news as it almost happens: www.youtube.com/user/LastWeekTonight\n\nFind Last Week Tonight on Facebook like your mom would:\nhttp://Facebook.com/LastWeekTonight\n\nFollow us on Twitter for news about jokes and jokes about news:\nhttp://Twitter.com/LastWeekTonight\n\nVisit our official site for all that other stuff at once:\nhttp://www.hbo.com/lastweektonight";s:7:"content";s:777:"Under federal law, even legal marijuana is illegal. John Oliver explains why conflicting drug laws pose serious problems.\n\nConnect with Last Week Tonight online...\nSubscribe to the Last Week Tonight YouTube channel for more almost news as it almost happens: www.youtube.com/user/LastWeekTonight\n\nFind Last Week Tonight on Facebook like your mom would:\n<a target="_blank" href="http://Facebook.com/LastWeekTonight">http://Facebook.com/LastWeekTonight</a>\n\nFollow us on Twitter for news about jokes and jokes about news:\n<a target="_blank" href="http://Twitter.com/LastWeekTonight">http://Twitter.com/LastWeekTonight</a>\n\nVisit our official site for all that other stuff at once:\n<a target="_blank" href="http://www.hbo.com/lastweektonight">http://www.hbo.com/lastweektonight</a>";s:15:"thumb_image_url";s:48:"https://i.ytimg.com/vi/BcR_Wg42dv8/mqdefault.jpg";s:9:"image_url";s:52:"https://i.ytimg.com/vi/BcR_Wg42dv8/maxresdefault.jpg";s:4:"date";s:24:"2017-04-03T06:30:00.000Z";s:4:"tags";a:3:{i:0;s:27:"last week tonight marijuana";i:1;s:21:"john oliver marijuana";i:2;s:9:"marijuana";}s:10:"channel_id";s:24:"UC3XTzVzaHQEd30rQbuvCtTQ";s:12:"creator_name";s