m/vi/DnrogB0uOfc/mqdefault.jpg";s:9:"image_url";s:52:"https://i.ytimg.com/vi/DnrogB0uOfc/maxresdefault.jpg";s:4:"date";s:24:"2017-04-02T09:40:48.000Z";s:4:"tags";a:16:{i:0;s:12:"learn colors";i:1;s:15:"color spiderman";i:2;s:17:"spiderman cartoon";i:3;s:10:"kids learn";i:4;s:19:"kids learning video";i:5;s:13:"kids learning";i:6;s:14:"children learn";i:7;s:13:"learn numbers";i:8;s:8:"fun cars";i:9;s:11:"color video";i:10;s:15:"education video";i:11;s:14:"nursery rhymes";i:12;s:13:"finger family";i:13;s:17:"children learning";i:14;s:20:"color video for kids";i:15;s:27:"learning video for children";}s:10:"channel_id";s:24:"UCZktQz6bV7REeyutqhSe17A";s:12:"creator_name";s:8:"Heroland";s:9:"media_url";s:43:"https://www.youtube.com/watch?v=DnrogB0uOfc";s:9:"embed_url";N;s:4:"site";s:7:"youtube";}i:2;a:13:{s:2:"id";s:11:"Liq1qizvnw8";s:5:"title";s:41:"5 Mercedes-Benz Concept Cars YOU MUST SEE";s:16:"content_original";s:1906:"5 Mercedes-Benz Concept Cars YOU MUST SEE\nClick here for: Top 5 Luxury Cars 2017\nhttps://www.youtube.com/watch?v=yH46mtKn32M\n\n5. Mercedes-Benz Vision Tokyo\n4. Mercedes-Benz AMG Vision Gran Turismo\n3. Mercedes-Benz F 015 Luxury in Motion\n2. Mercedes-Benz Generation EQ Concept\n1. Mercedes-Benz Concept IAA\n\nMercedes-Benz Vision Tokyo :\nThe Vision Tokyo is the latest trailblazing spatial experience to come from Mercedes-Benz: its monolithic structure, futuristic design idiom and unique lounge ambience in the interior define it as luxurious, young and progressive – thus making it a fitting tribute to the sophisticated megacity and trendsetting metropolis that is Tokyo. \n\nMercedes-Benz AMG Vision Gran Turismo :\nThe sports car proportions that are a typical Mercedes-Benz feature have been reinterpreted: the long bonnet has a flowing transition into a compact greenhouse offset to the rear, which takes the form of an aerodynamically efficient water drop to descend slightly at the rear, where it rests on the rear end with broad shoulder contours.\n\nMercedes-Benz F 015 Luxury in Motion :\nIn order to provide a foundation for the new autonomous F 015 Luxury in Motion research vehicle, an interdisciplinary team of experts from Mercedes-Benz has devised a future scenario that incorporates many different aspects of day-to-day mobility.\n\nMercedes-Benz Generation EQ Concept :\nAt the Paris Motor Show, Mercedes-Benz will unveil its new product brand for electric mobility: EQ. The name EQ stands for “Electric Intelligence” and is derived from the Mercedes-Benz brand values of “Emotion and Intelligence”.\n\nMercedes-Benz Concept IAA :\nhe Mercedes-Benz “Concept IAA” (Intelligent Aerodynamic Automobile) is two cars in one: an aerodynamics world champion with a Cd value of 0.19 and a four-door coupé embodying irresistible design. \n\nCredits : AutoGuide.com\nPlease Subscribe :) Its Free ..";s:7:"content";s:1980:"5 Mercedes-Benz Concept Cars YOU MUST SEE\nClick here for: Top 5 Luxury Cars 2017\n<a target="_blank" href="https://www.youtube.com/watch?v=yH46mtKn32M">https://www.youtube.com/watch?v=yH46mtKn32M</a>\n\n5. Mercedes-Benz Vision Tokyo\n4. Mercedes-Benz AMG Vision Gran Turismo\n3. Mercedes-Benz F 015 Luxury in Motion\n2. Mercedes-Benz Generation EQ Concept\n1. Mercedes-Benz Concept IAA\n\nMercedes-Benz Vision Tokyo :\nThe Vision Tokyo is the latest trailblazing spatial experience to come from Mercedes-Benz: its monolithic structure, futuristic design idiom and unique lounge ambience in the interior define it as luxurious, young and progressive – thus making it a fitting tribute to the sophisticated megacity and trendsetting metropolis that is Tokyo. \n\nMercedes-Benz AMG Vision Gran Turismo :\nThe sports car proportions that are a typical Mercedes-Benz feature have been reinterpreted: the long bonnet has a flowing transition into a compact greenhouse offset to the rear, which takes the form of an aerodynamically efficient water drop to descend slightly at the rear, where it rests on the rear end with broad shoulder contours.\n\nMercedes-Benz F 015 Luxury in Motion :\nIn order to provide a foundation for the new autonomous F 015 Luxury in Motion research vehicle, an interdisciplinary team of experts from Mercedes-Benz has devised a future scenario that incorporates many different aspects of day-to-day mobility.\n\nMercedes-Benz Generation EQ Concept :\nAt the Paris Motor Show, Mercedes-Benz will unveil its new product brand for electric mobility: EQ. The name EQ stands for “Electric Intelligence” and is derived from the Mercedes-Benz brand values of “Emotion and Intelligence”.\n\nMercedes-Benz Concept IAA :\nhe Mercedes-Benz “Concept IAA” (Intelligent Aerodynamic Automobile) is two cars in one: an aerodynamics world champion with a Cd value of 0.19 and a four-door coupé embodying irresistible design. \n\nCredits : AutoGuide.com\nPlease Subscribe :) Its Free ..";s:15:"thumb_image_url";s:48:"https://i.ytimg.com/vi/Liq1qizvnw8/mqdefault.jpg";s:9:"image_url";s:52:"https://i.ytimg.com/vi/Liq1qizvnw8/maxresdefault.jpg";s:4:"date";s:24:"2017-04-01T17:49:06.000Z";s:4:"tags";a:22:{i:0;s:32:"Top 5 Mercedes-Benz Concept Cars";i:1;s:26:"Mercedes-Benz Concept Cars";i:2;s:21:"Mercedes concept cars";i:3;s:12:"Concept Cars";i:4;s:11:"Future Cars";i:5;s:10:"Future Car";i:6;s:4:"cars";i:7;s:18:"cars of the future";i:8;s:6:"future";i:9;s:17:"top 5 future cars";i:10;s:13:"5 future cars";i:11;s:19:"future concept cars";i:12;s:19:"future cars of 2020";i:13;s:18:"Top 5 concept Cars";i:14;s:13:"electric cars";i:15;s:15:"Autonomous Cars";i:16;s:15:"Mercedes Future";i:17;s:13:"Mercedes-Benz";i:18;s:25:"Mercedes-Benz Concept IAA";i:19;s:35:"Mercedes-Benz Generation EQ Concept";i:20;s:25:"Concept Cars YOU MUST SEE";i:21;s:15:"Future Car 2020";}s:10:"channel_id";s:24:"UC3QR34uMm1pxfkZyUMeLhXw";s:12:"creator_name";s:11:"Thansis1997";s:9:"media_url";s:43:"https://www.youtube.com/watch?v=Liq1qizvnw8";s:9:"embed_url";N;s:4:"site";s:7:"youtube";}i:3;a:13:{s:2:"id";s:11:"zbnyrzY8fNc";s:5:"title";s:27:"I\'M SELLING ALL OF MY CARS!";s:16:"content_original";s:1205:"I\'ve decided everything has got a little bit out of hand so I\'m going to sell all of my cars; the McLaren, Ferrari, both Astons, and even the Focus RS and the Mini... It\'s time to consolidate and drive one single car that\'s much more practical and all around rather than the complications that come with so many in the garage.\n\n...\n\nIt is of course APRIL FOOL\'S! But interestingly, this is the first time I\'ve driven a Volvo, in my life (I think), the new S90 D4 and it\'s not too bad to be completely honest.\n\nAfter one or two more videos, I\'ll be embarking on my annual Where\'s Shmee Eurotour that\'s taking in a few weeks of adventure across the continent. I\'ll be stopping at Cars & Coffee Brescia, Car Freitag at the Nurburgring, the Motorworld in Suttgart and of course at Top Marques Monaco. More details will follow seen so keep eyes out on my social media pages but there\'s a lot to come and hopefully some cool content that you\'ll enjoy.\n\nI hope this didn\'t get taken the wrong way, just a gentle April Fool\'s Day joke!\n\nThanks for watching, Tim\n\nSubscribe: http://bit.ly/Shmee150YT\nWebsite: http://www.shmee150.com\nFacebook: http://www.fb.com/shmee150\nInstagram: http://www.instagram.com/shmee150";s:7:"content";s:1435:"I\'ve decided everything has got a little bit out of hand so I\'m going to sell all of my cars; the McLaren, Ferrari, both Astons, and even the Focus RS and the Mini... It\'s time to consolidate and drive one single car that\'s much more practical and all around rather than the complications that come with so many in the garage.\n\n...\n\nIt is of course APRIL FOOL\'S! But interestingly, this is the first time I\'ve driven a Volvo, in my life (I think), the new S90 D4 and it\'s not too bad to be completely honest.\n\nAfter one or two more videos, I\'ll be embarking on my annual Where\'s Shmee Eurotour that\'s taking in a few weeks of adventure across the continent. I\'ll be sto