7 Nissan GT-R\n4- 2017 Audi R8 plus quattro Coupe\n3- 2017 Acura NSX Base\n2- 2017 Mazda MX-5 Miata Grand Touring (M6)\n1- 2017 Alfa Romeo 4C Base\n\nSong: <a target="_blank" href="https://www.youtube.com/channel/UC3ZRbow2zrSS23-oLzRDt6A">https://www.youtube.com/channel/UC3ZRbow2zrSS23-oLzRDt6A</a>\n_<a target="_blank" href="https://www.youtube.com/watch?v=q1ULJ92aldE">https://www.youtube.com/watch?v=q1ULJ92aldE</a>\n_<a target="_blank" href="https://www.youtube.com/user/NoCopyrightSounds">https://www.youtube.com/user/NoCopyrightSounds</a>";s:15:"thumb_image_url";s:48:"https://i.ytimg.com/vi/ApccW1XBIn0/mqdefault.jpg";s:9:"image_url";s:52:"https://i.ytimg.com/vi/ApccW1XBIn0/maxresdefault.jpg";s:4:"date";s:24:"2017-04-03T19:35:50.000Z";s:4:"tags";a:14:{i:0;s:11:"sports cars";i:1;s:6:"Top 10";i:2;s:7:"Elie TV";i:3;s:10:"Elie Rasho";i:4;s:16:"2017 Dodge Viper";i:5;s:17:"Aston Martin DB11";i:6;s:20:"Porsche 718 Cayman S";i:7;s:17:"Ford Shelby GT350";i:8;s:18:"Chevrolet Corvette";i:9;s:11:"Nissan GT-R";i:10;s:26:"Audi R8 plus quattro Coupe";i:11;s:14:"Acura NSX Base";i:12;s:10:"Mazda MX-5";i:13;s:18:"Alfa Romeo 4C Base";}s:10:"channel_id";s:24:"UCR8muZmgFKZ2qTAFFVQeELg";s:12:"creator_name";s:7:"Elie TV";s:9:"media_url";s:43:"https://www.youtube.com/watch?v=ApccW1XBIn0";s:9:"embed_url";N;s:4:"site";s:7:"youtube";}i:4;a:13:{s:2:"id";s:11:"MZo8QyWjXu8";s:5:"title";s:17:"Top 10 GTA 5 cars";s:16:"content_original";s:0:"";s:7:"content";s:0:"";s:15:"thumb_image_url";s:48:"https://i.ytimg.com/vi/MZo8QyWjXu8/mqdefault.jpg";s:9:"image_url";s:48:"https://i.ytimg.com/vi/MZo8QyWjXu8/hqdefault.jpg";s:4:"date";s:24:"2017-04-03T19:27:51.000Z";s:4:"tags";N;s:10:"channel_id";s:24:"UCOpur2N3Cu8100OtbAC9_og";s:12:"creator_name";s:14:"XPI Deathunter";s:9:"media_url";s:43:"https://www.youtube.com/watch?v=MZo8QyWjXu8";s:9:"embed_url";N;s:4:"site";s:7:"youtube";}i:5;a:13:{s:2:"id";s:11:"Pl3bQCEQdu0";s:5:"title";s:42:"Top5 insane cars in the world must watch!!";s:16:"content_original";s:0:"";s:7:"content";s:0:"";s:15:"thumb_image_url";s:48:"https://i.ytimg.com/vi/Pl3bQCEQdu0/mqdefault.jpg";s:9:"image_url";s:48:"https://i.ytimg.com/vi/Pl3bQCEQdu0/sddefault.jpg";s:4:"date";s:24:"2017-04-03T19:13:39.000Z";s:4:"tags";N;s:10:"channel_id";s:24:"UCmYkxdav_-84AZOJlwf-_mQ";s:12:"creator_name";s:11:"Kamal Azzam";s:9:"media_url";s:43:"https://www.youtube.com/watch?v=Pl3bQCEQdu0";s:9:"embed_url";N;s:4:"site";s:7:"youtube";}i:6;a:13:{s:2:"id";s:11:"u5b18RR8H2o";s:5:"title";s:27:"Top 5 Future Automated Cars";s:16:"content_original";s:4023:"An automatic transmission, also called auto, self-shifting transmission, n-speed automatic (where n is its number of forward gear ratios), or AT, is a type of motor vehicle transmission that can automatically change gear ratios as the vehicle moves, freeing the driver from having to shift gears manually. Like other transmission systems on vehicles, it allows an internal combustion engine, best suited to run at a relatively high rotational speed, to provide a range of speed and torque outputs necessary for vehicular travel. The number of forward gear ratios is often expressed for manual transmissions as well (e.g., 6-speed manual).\n\nThe most popular form found in automobiles is the hydraulic automatic transmission. Similar but larger devices are also used for heavy-duty commercial and industrial vehicles and equipment. This system uses a fluid coupling in place of a friction clutch, and accomplishes gear changes by hydraulically locking and unlocking a system of planetary gears. These systems have a defined set of gear ranges, often with a parking pawl that locks the output shaft of the transmission to keep the vehicle from rolling either forward or backward. Some machines with limited speed ranges or fixed engine speeds, such as some forklifts and lawn mowers, only use a torque converter to provide a variable gearing of the engine to the wheels.\n\nBesides the traditional hydraulic automatic transmissions, there are also other types of automated transmissions, such as a continuously variable transmission (CVT) and semi-automatic transmissions, that free the driver from having to shift gears manually, by using the transmission\'s computer to change gear, if for example the driver were redlining the engine. Despite superficial similarity to other transmissions, traditional automatic transmissions differ significantly in internal operation and driver\'s feel from semi-automatics and CVTs. In contrast to conventional automatic transmissions, a CVT uses a belt or other torque transmission scheme to allow an "infinite" number of gear ratios instead of a fixed number of gear ratios. A semi-automatic retains a clutch like a manual transmission, but controls the clutch through electrohydraulic means. The ability to shift gears manually, often via paddle shifters, can also be found on certain automated transmissions (manumatics such as Tiptronic), semi-automatics (BMW SMG, VW Group DSG), and CVTs (such as Lineartronic).\n\nThe obvious advantage of an automatic transmission to the driver is the lack of a clutch pedal and manual shift pattern in normal driving. This allows the driver to operate the car with as few as two limbs (possibly using assist devices to position controls within reach of usable limbs), allowing amputees and other disabled individuals to drive. The lack of manual shifting also reduces the attention and workload required inside the cabin, such as monitoring the tachometer and taking a hand off the wheel to move the shifter, allowing the driver to ideally keep both hands on the wheel at all times and to focus more on the road. Control of the car at low speeds is often easier with an automatic than a manual, due to a side effect of the clutchless fluid-coupling design called "creep" that causes the car to want to move while in a driving gear, even at idle. The primary disadvantage of the most popular hydraulic designs is reduced mechanical efficiency of the power transfer between engine and drivetrain, due to the fluid coupling connecting the engine to the gearbox. This can result in lower power/torque ratings for automatics compared to manuals with the same engine specs, as well as reduced fuel efficiency in city driving as the engine must maintain idle against the resistance of the fluid coupling. Advances in transmission and coupler design have narrowed this gap considerably, but clutch-based transmissions (manual or semi-automatic) are still preferred in sport-tuned trim levels of various production cars, as well as in many auto racing leagues.";s:7:"content";s:4023:"An automatic transmission, also called auto, self-shifting transmission, n-speed automatic (where n is its number of forward gear ratios), or AT, is a type of motor vehicle transmission that can automatically change gear ratios as the vehicle moves, freeing the driver from having to shift gears manually. Like other transmission systems on vehicles, it allows an internal combustion engine, best suited to run at a relatively high rotational speed, to provide a range of speed and torque outputs necessary for vehicular travel. The number of forward gear ratios is often expressed for manual transmissions as well (e.g., 6-speed manual).\n\nThe most popular form found in automobiles is the hydraulic automatic transmission. Similar but larger devices are also used for heavy-duty commercial and industrial vehicles and equipment. This system uses a fluid coupling in place of a friction clutch, and accomplishes gear changes by hydraulically locking and unlocking a system of planetary gears. These systems have a defined set of gear ranges, often with a parking pawl that locks the output shaft of the transmission to keep the vehicle from rolling either forward or backward. Some machines with limited speed ranges or fixed engine speeds, such as some forklifts and lawn mowers, only use a torque converter to provide a variable gearing of the engine to the wheels.\n\nBesides the traditional hydraulic automatic transmissions, there are also other types of automated transmissions, such as a continuously variable transmission (CVT) and semi-automatic transmissions, that free the driver from having to shift gears manually, by using the transmission\'s computer to change gear, if for example the driver were redlining the engine. Despite superficial similarity to other transmissions, traditional automatic transmissions differ significantly in internal operation and driver\'s feel from semi-automatics and CVTs. In contrast to conventional automatic transmissions, a CVT uses a belt or other torque transmission scheme to allow an "infinite" number of gear ratios instead of a fixed number of gear ratios. A semi-automatic retains a clutch like a manual transmission, but controls the clutch through electrohydraulic means. The ability to shift gears manually, often via paddle shifters, can also be found on certain automated transmissions (manumatics such as Tiptronic), semi-automatics (BMW SMG, VW Group DSG), and CVTs (such as Lineartronic).\n\nThe obvious advantage of an automatic transmission to the driver is the lack of a clutch pedal and manual shift pattern in normal driving. This allows the driver to operate the car with as few as two limbs (possibly using assist devices to position controls within reach of usable limbs), allowing amputees and other disabled individuals to drive. The lack of manual shifting also reduces the attention and workload required inside the cabin, such as monitoring the tachometer and taking a hand off the wheel to move the shifter, allowing the driver to ideally keep both hands on the wheel at all times and to focus more on the road. Control of the car at low speeds is often easier with an automatic than a manual, due to a side effect of the clutchless fluid-coupling design called "creep" that causes the car to want to move while in a driving gear, even at idle. The primary disadvantage of the most popular hydraulic designs is reduced mechanical efficiency of the power transfer between engine and drivetrain, due to the fluid coupling connecting the engine to the gearbox. This can result in lower power/torque ratings for automatics compared to manuals with the same engine specs, as well as reduced fuel efficiency in city driving as the engine must maintain idle against the resistance of the fluid coupling. Advances in transmission and coupler design have narrowed this gap considerably, but clutch-based transmissions (manual or semi-automatic) are still preferred in sport-tuned trim levels of various production cars, as well as in many auto racing leagues.";s:15:"thumb_image_url";s:48:"https://i.ytimg.com/vi/u5b18RR8H2o/mqdefault.jpg";s:9:"image_url";s:48:"https://i.ytimg.com/vi/u5b18RR8H2o/sddefault.jpg";s:4:"date";s:24:"2017-04-03T19:10:59.000Z";s:4:"tags";a:11:{i:0;s:27:"top 5 future automated cars";i:1;s:5:"top 5";i:2;s:23:"top 5 future technology";i:3;s:26:"future technology vehicles";i:4;s:19:"driverless vehicles";i:5;s:15:"future vehicles";i:6;s:18:"automated vehicles";i:7;s:4:"cars";i:8;s:11:"Future cars";i:9;s:14:"automated cars";i:10;s:9:"cars 2017";}s:10:"channel_id";s:24:"UCosyJmvBjipA4s3udHx_zvQ";s:12:"creator_name";s:17:"Future Technology";s:9:"media_url";s:43:"https://www.youtube.com/watch?v=u5b18RR8H2o";s:9:"embed_url";N;s:4:"site";s:7:"youtube";}i:7;a:13:{s:2:"id";s:11:"ktG5yE0rJTI";s:5:"title";s:30:"My Top 5 Fast And Furious Cars";s:16:"content_original";s:40:"Fate of the furious comes out April 14th";s:7:"content";s:40:"Fate of the furious comes out April 14th";s:15:"thumb_image_url";s:48:"https://i.ytimg.com/vi/ktG5yE0rJTI/mqdefault.jpg";s:9:"image_url";s:52:"https://i.ytimg.com/vi/ktG5yE0rJTI/maxresdefault.jpg";s:4:"date";s:24:"2017-04-03T18:59:48.000Z";s:4:"tags";N;s:10:"channel_id";s:24:"UCHkxywmOsgtQAWGudnAW8cQ";s:12:"creator_name";s:12:"Whiplash8059";s:9:"media_url";s:43:"https://www.youtube.com/watch?v=ktG5yE0rJTI";s:9:"embed_url";N;s:4:"site";s:7:"youtube";}i:8;a:13:{s:2:"id