(492, '_transient_tube-yt-srch-qry-33ee2f6cfc051903c07c5652d4cb331a', 'a:5:{s:13:"total_results";i:1000000;s:16:"results_per_page";i:10;s:15:"next_page_token";s:6:"CAoQAA";s:15:"prev_page_token";N;s:5:"items";a:10:{i:0;a:13:{s:2:"id";s:11:"lZYyT7MO0g4";s:5:"title";s:22:"DUCK SONG WRONG LYRICA";s:16:"content_original";s:0:"";s:7:"content";s:0:"";s:15:"thumb_image_url";s:48:"https://i.ytimg.com/vi/lZYyT7MO0g4/mqdefault.jpg";s:9:"image_url";s:52:"https://i.ytimg.com/vi/lZYyT7MO0g4/maxresdefault.jpg";s:4:"date";s:24:"2017-04-03T17:34:52.000Z";s:4:"tags";N;s:10:"channel_id";s:24:"UCP0x5AP61xqZYkDU4cQnJhw";s:12:"creator_name";s:11:"Kylie M Lps";s:9:"media_url";s:43:"https://www.youtube.com/watch?v=lZYyT7MO0g4";s:9:"embed_url";N;s:4:"site";s:7:"youtube";}i:1;a:13:{s:2:"id";s:11:"htjSIW-793Y";s:5:"title";s:44:"Anitales: "The duck song (Ep. 2)" - emojiman";s:16:"content_original";s:133:"\'\'Quack!\', duck said\'. \'The duck song (Ep. 2)\' created by emojiman using the Anitales app. Join Anitales now at https://goo.gl/flzS2A";s:7:"content";s:185:"\'\'Quack!\', duck said\'. \'The duck song (Ep. 2)\' created by emojiman using the Anitales app. Join Anitales now at <a target="_blank" href="https://goo.gl/flzS2A">https://goo.gl/flzS2A</a>";s:15:"thumb_image_url";s:48:"https://i.ytimg.com/vi/htjSIW-793Y/mqdefault.jpg";s:9:"image_url";s:48:"https://i.ytimg.com/vi/htjSIW-793Y/sddefault.jpg";s:4:"date";s:24:"2017-04-03T17:26:17.000Z";s:4:"tags";a:4:{i:0;s:8:"Anitales";i:1;s:13:"Cartoon Story";i:2;s:10:"Make Story";i:3;s:12:"Make Cartoon";}s:10:"channel_id";s:24:"UCkohSFXfChvfD8eEibN5Oxw";s:12:"creator_name";s:19:"Anitales - Mibao IT";s:9:"media_url";s:43:"https://www.youtube.com/watch?v=htjSIW-793Y";s:9:"embed_url";N;s:4:"site";s:7:"youtube";}i:2;a:13:{s:2:"id";s:11:"v6jQfHwGLPM";s:5:"title";s:19:"Making of Duck Funk";s:16:"content_original";s:2321:"Welcome to another "Behind The Music" episode. This time we\'re taking a look behind the curtain on our original song "Duck Funk". \n\nAs stated in the original performance blog which you can check out HERE, this is a song that\'s been sitting around for a few months until Paul and I had a chance to fill a spot that week. I think we were originally going to take the week off from filming but ultimately decided to give this one a go.\n\nThis song was pre written before we filmed it. I wrote the whole song and format out and also laid out demo drums over the track before I sent it to Paul to see what he thought. It\'s always great to see a song of ours go from concept to video, sometimes in the matter of a week or so depending on how much time and material we have.\n\nThis episode was filmed in the "Nest" (my studio) and Paul edned up bringing in an old guitar cabinet that he\'s had for a long time. There\'s a segment in this episode where he talks about how long he\'s had it and what it means to him so make sure to check that out. As far as he\'s concerned it\'s gonna stay there in the Nest for him to use when he\'s over. Less gear to haul around, which any musician can appreciate:)\n\nMost, if not all the gear in my studio and in Paul\'s (The Neast) stays there full time. Unless we have a gig. Then we pack up and head out. But, because we record and film in these rooms it\'s nice to have things set up somewhat permanently so we don\'t have to set things back up everytime we have a session. It\'s taken a little while for us to get into this routine but as of now we are running full speed with these episodes!\n\nThanks for swinging by and checking out the making of Duck Funk. This actually turned out to be a fun tune. I wasn\'t sure where we were going to take it but I\'m pretty happy with the results. We hope you agree!\n\n\nConsider checking out the blog behind this song on our website here:\n http://www.rockbottombros.com/behind-the-music-duck-funk\n\n-------------------------\nWe know you have millions of choices out on YouTube so THANK YOU for checking us out! \nFind out More at:\nwww.RockBottomBros.com\nwww.soundcloud.com/RockBottomBros\nFacebook: www.Facebook.com/RockBottomBros\nInstagram: @rockbottombros\nTwitter: @rockbottombros\nOr Just ask below!\n\n\n\nTil next time friends, keep rockin it out there!\n\n$Mike (RBB)";s:7:"content";s:2408:"Welcome to another "Behind The Music" episode. This time we\'re taking a look behind the curtain on our original song "Duck Funk". \n\nAs stated in the original performance blog which you can check out HERE, this is a song that\'s been sitting around for a few months until Paul and I had a chance to fill a spot that week. I think we were originally going to take the week off from filming but ultimately decided to give this one a go.\n\nThis song was pre written before we filmed it. I wrote the whole song and format out and also laid out demo drums over the track before I sent it to Paul to see what he thought. It\'s always great to see a song of ours go from concept to video, sometimes in the matter of a week or so depending on how much time and material we have.\n\nThis episode was filmed in the "Nest" (my studio) and Paul edned up bringing in an old guitar cabinet that he\'s had for a long time. There\'s a segment in this episode where he talks about how long he\'s had it and what it means to him so make sure to check that out. As far as he\'s concerned it\'s gonna stay there in the Nest for him to use when he\'s over. Less gear to haul around, which any musician can appreciate:)\n\nMost, if not all the gear in my studio and in Paul\'s (The Neast) stays there full time. Unless we have a gig. Then we pack up and head out. But, because we record and film in these rooms it\'s nice to have things set up somewhat permanently so we don\'t have to set things back up everytime we have a session. It\'s taken a little while for us to get into this routine but as of now we are running full speed with these episodes!\n\nThanks for swinging by and checking out the making of Duck Funk. This actually turned out to be a fun tune. I wasn\'t sure where we were going to take it but I\'m pretty happy with the results. We hope you agree!\n\n\nConsider checking out the blog behind this song on our website here:\n <a target="_blank" href="http://www.rockbottombros.com/behind-the-music-duck-funk">http://www.rockbottombros.com/behind-the-music-duck-funk</a>\n\n-------------------------\nWe know you have millions of choices out on YouTube so THANK YOU for checking us out! \nFind out More at:\nwww.RockBottomBros.com\nwww.soundcloud.com/RockBottomBros\nFacebook: www.Facebook.com/RockBottomBros\nInstagram: @rockbottombros\nTwitter: @rockbottombros\nOr Just ask below!\n\n\n\nTil next time friends, keep rockin it out there!\n\n$Mike (RBB)";s:15:"thumb_image_url";s:48:"https://i.ytimg.com/vi/v6jQfHwGLPM/mqdefault.jpg";s:9:"image_url";s:52:"https://i.ytimg.com/vi/v6jQfHwGLPM/maxresdefault.jpg";s:4:"date";s:24:"2017-04-03T16:34:28.000Z";s:4:"tags";a:16:{i:0;s:16:"behind the music";i:1;s:4:"vlog";i:2;s:16:"rock bottom bros";i:3;s:17:"behind the scenes";i:4;s:10:"rock bands";i:5;s:15:"the bass player";i:6;s:11:"the drummer";i:7;s:10:"indie rock";i:8;s:11:"indie music";i:9;s:10:"indie band";i:10;s:11:"music video";i:11;s:10:"rock indie";i:12;s:11:"funky music";i:13;s:10:"rock music";i:14;s:5:"party";i:15;s:3:"vlo";}s:10:"channel_id";s:24:"UCJkO9wLd9v4D-ZQ0thv7Nvw";s:12:"creator_name";s:16:"Rock Bottom Bros";s:9:"media_url";s:43:"https://www.youtube.com/watch?v=v6jQfHwGLPM";s:9:"embed_url";N;s:4:"site";s:7:"youtube";}i:3;a:13:{s:2:"id";s:11:"386ZwDn-I2g";s:5:"title";s:30:"Duck Song 3- Música do Pato 3";s:16:"content_original";s:19:"Mais uma musiquinha";s:7:"content";s:19:"Mais uma musiquinha";s:15:"thumb_image_url";s:48:"https://i.ytimg.com/vi/386ZwDn-I2g/mqdefault.jpg";s:9:"image_url";s:52:"https://i.ytimg.com/vi/386ZwDn-I2g/maxresdefault.jpg";s:4:"date";s:24:"2017-04-03T15:17:53.000Z";s:4:"tags";N;s:10:"channel_id";s:24:"UCWGdZTjRi-uMRxoOgJGFTag";s:12:"creator_name";s:7:"SpeedOn";s:9:"media_url";s:43:"https://w