(501, '_transient_tube-yt-srch-qry-a892185b12932e3ea6a051d9655e6626', 'a:5:{s:13:"total_results";i:1000000;s:16:"results_per_page";i:10;s:15:"next_page_token";s:6:"CAoQAA";s:15:"prev_page_token";N;s:5:"items";a:10:{i:0;a:13:{s:2:"id";s:11:"cwiD0KYq2cE";s:5:"title";s:99:"Fast & Furious Stunt Stars Dom + Ice Charger, Hobbs + Navistar MXT & Hobbs + Navistar MXT by Mattel";s:16:"content_original";s:3999:"Stunt action with the stars from the Fast and Furious movies. Three cars that launch 2-inch action figures so you can create stunts, action scenes or all kinds of make believe mayhem. Check out the three iconic cars from the film, and see them in action in this video! For full review and shopping info► https://ttpm.com/p/22836/mattel/fast-furious-stunt-stars-dom-ice-charger/?ref=yt\nhttps://ttpm.com/p/22837/mattel/fast-furious-stunt-stars-hobbs-navistar-mxt/?ref=yt\nhttps://ttpm.com/p/22838/mattel/fast-furious-stunt-stars-tej-jeep-wrangler-rubicon/?ref=yt\n\nProduct Info: You know how when you see a really cool stunt someone always says, “Don’t try this at home kids?” Kind of a buzz kill, right? Well, now you can, at least in a toy version with the Fast and Furious Stunt Stars collection from Mattel—three cars and mini action figures that let you recreate,with toys, the stunts you really shouldn’t try in real life. \n\nEach set comes with a car and an approximately 2-inch tall figure of the Fast and Furious character that goes along with it. So, we’ve got Tej and the Jeep Wrangler Rubicon, Hobbs and the Navistar MXT and, of course, Dom and his Ice Charger, which has a really big role in The Fate of the Furious. \n\nEach of the figures fits inside the car for freewheeling action play. But you know these guys never drive like normal people. They’re inevitably going to get involved in all kinds of crazy stunts, and these toys are no exception. \n\nWhen it’s time for something a little more daring than tooling around the playroom, check this out. Each figure fits on the hood of a car, then press the button in the roof to send the figure flying. It’s kind of silly, to be sure, but it does create a lot of imaginative fun, especially if you get a whole bunch of them together. Then, you can go wild trying to make them jump from one vehicle to the other as you imagine yourself in the equally imaginative (as in, this could NEVER happen) world of the Fast and the Furious. \n\nIs the flying accurate? No. Can you really do amazing stunts? Depends. Kids are in control. The one thing for sure is that they can create make believe mayhem, and that’s the whole point—and fun—of this line.\n\n\n\n✮SEE MORE TOYS✮\nMICKEY MOUSE CLUBHOUSE HOT DIGGITY DANCING MICKEY:\nhttps://ttpm.com/p/20337/just-play/mickey-mouse-clubhouse-hot-diggity-dancing-mickey/?ref=yt\n\nDESCENDANTS DIGITAL RECORDING STUDIO:\nhttps://ttpm.com/p/20424/ekids/descendants-digital-recording-studio/?ref=yt\n\nTROLLS POPPY\'S STYLIN\' POD:\nhttps://ttpm.com/p/20443/hasbro/trolls-poppys-stylin-pod/?ref=yt\n\n✮SUBSCRIBE TTPM Toy Reviews✮\nhttps://www.youtube.com/c/ttpm\n\n✮SUBSCRIBE TTPM Baby Gear Reviews✮\nhttps://www.youtube.com/c/ttpmbaby\n\n✮SUBSCRIBE TTPM Pet Toys & Gear Reviews✮\nhttps://www.youtube.com/c/ttpmpets\n\n✮SUBSCRIBE TTPM First Look Toys Unboxing✮\nhttps://www.youtube.com/c/ttpmfirstlooktoys\n\n✮FOLLOW US✮\nFacebook: https://www.facebook.com/TTPMOfficial\nTwitter: https://twitter.com/ttpm\nInstagram: https://instagram.com/ttpmofficial/\nPinterest: https://www.pinterest.com/ttpmofficial/\nSnapchat: TTPMOfficial: https://www.snapchat.com/add/ttpmofficial\n\n✮FOLLOW TTPM Baby✮\nFacebook: https://www.facebook.com/TTPMBaby/\nTwitter: https://twitter.com/TTPMbaby\nInstagram: https://www.instagram.com/ttpmbaby/\n\n✮FOLLOW TTPM Pets✮\nFacebook: https://www.facebook.com/TTPMPets\nTwitter: https://twitter.com/TTPMPets\nInstagram: https://www.instagram.com/ttpmpets/\nPinterest: https://www.pinterest.com/ttpmpets/\n\n\n\nDisclosure: Toys reviewed by TTPM are selected by the TTPM edit