ається повернути те, що по праву належить їй...\n\nСайти: https://facebook.com/TheMummy\nhttp://www.themummy.com";s:7:"content";s:2109:"Прем\'єра (світ): 08/06/2016\nПрем\'єра (Росія): 08/06/2016\nПрем\'єра (Україна): 08/06/2016\n \nБільше трейлерів: <a target="_blank" href="https://goo.gl/WOxOmh">https://goo.gl/WOxOmh</a>\n\nНазва: Мумія\nОригінальна назва: The Mummy\nРік виходу: 2017\nЖанр: жахи, фентезі, бойовик, пригоди\nКраїна: США\nРежисер: Алекс Куртцман\nУ ролях: Софія Бутелла, Том Круз, Аннабелль Уолліс, Рассел Кроу, Джейк Джонсон, Кортні Б. Венс, Хав\'єр Ботет, Хорхе Леон Мартінес, Марван Кензарі, Сіна Сіхоко Нагаї\n\nПро фільм: Загін спеціального призначення проводить в пустелі операцію по знешкодженню групи терористів. Спустившись в бункер, вони не виявляють ворога, але знаходять древній саркофаг, який вирішують доставити на базу для подальшого вивчення. Однак під час перельоту відбувається низка дивних подій, в результаті яких військовий літак зазнає аварії. Всі, хто був на борту, загинули, і тільки Ніку Мортону дивом вдалося вижити. Пізніше він дізнається про те, що військові виявили стародавню гробницю дочки єгипетського фараона - Аманет. Через тисячоліття вона повернулася в наш світ і тепер збирається повернути те, що по праву належить їй...\n\nСайти: <a target="_blank" href="https://facebook.com/TheMummy">https://facebook.com/TheMummy</a>\n<a target="_blank" href="http://www.themummy.com">http://www.themummy.com</a>";s:15:"thumb_image_url";s:48:"https://i.ytimg.com/vi/jTGVnog7N2U/mqdefault.jpg";s:9:"image_url";s:52:"https://i.ytimg.com/vi/jTGVnog7N2U/maxresdefault.jpg";s:4:"date";s:24:"2017-04-03T21:28:38.000Z";s:4:"tags";a:14:{i:0;s:6:"mgames";i:1;s:8:"mgamesua";i:2;s:10:"mgamesnews";i:3;s:8:"mgamestv";i:4;s:9:"mgames_tv";i:5;s:70:"Мумія Офіційний український трейлер #2";i:6;s:10:"Мумія";i:7;s:67:"Мумія Офіційний український трейлер";i:8;s:22:"мумия 2017 укр";i:9;s:27:"мумия трейлер 2";i:10;s:38:"Мумия второй трейлер";i:11;s:40:"мумия русский трейл