(106, 1, '2017-02-07 11:00:00', '2017-02-07 11:00:00', 'Danny recalls how he felt when his team was down at halftime during the Super Bowl and talks about the Patriots\' upcoming celebratory parade.\n\nMean Tweets - NFL Edition #2 <a target="_blank" href="https://youtu.be/1T6J8hg7WFs">https://youtu.be/1T6J8hg7WFs</a>\n\nSUBSCRIBE to get the latest #KIMMEL: <a target="_blank" href="http://bit.ly/JKLSubscribe">http://bit.ly/JKLSubscribe</a>\n\nWatch the latest Halloween Candy Prank: <a target="_blank" href="http://bit.ly/KimmelHalloweenCandy">http://bit.ly/KimmelHalloweenCandy</a>\n\nWatch Mean Tweets: <a target="_blank" href="http://bit.ly/JKLMeanTweets8">http://bit.ly/JKLMeanTweets8</a>\n\nConnect with Jimmy Kimmel Live Online:\n\nVisit the Jimmy Kimmel Live WEBSITE: <a target="_blank" href="http://bit.ly/JKLWebsite">http://bit.ly/JKLWebsite</a>\nLike Jimmy Kimmel Live on FACEBOOK: <a target="_blank" href="http://bit.ly/JKLFacebook">http://bit.ly/JKLFacebook</a>\nFollow Jimmy Kimmel Live on TWITTER: <a target="_blank" href="http://bit.ly/JKLTwitter">http://bit.ly/JKLTwitter</a>\nFollow Jimmy Kimmel Live on INSTAGRAM: <a target="_blank" href="http://bit.ly/JKLInstagram">http://bit.ly/JKLInstagram</a>\n\nAbout Jimmy Kimmel Live:\nJimmy Kimmel serves as host and executive producer of Emmy-winning "Jimmy Kimmel Live," ABC\'s late-night talk show.\n \n"Jimmy Kimmel Live" is well known for its huge viral video successes with 2.5 billion views on YouTube alone. Some of Kimmel\'s most popular comedy bits include - Mean Tweets, Lie Witness News, Jimmy\'s Twerk Fail Prank, Unnecessary Censorship, YouTube Challenge, The Baby Bachelor, Movie: The Movie, Handsome Men\'s Club, Jimmy Kimmel Lie Detective and music videos like "I (Wanna) Channing All Over Your Tatum" and a Blurred Lines parody with Robin Thicke, Pharrell, Jimmy and his security guard Guillermo.\n \nNow in its fifteenth season, Kimmel\'s guests have included: Johnny Depp, Meryl Streep, Tom Cruise, Halle Berry, Harrison Ford, Jennifer Aniston, Will Ferrell, Katy Perry, Tom Hanks, Scarlett Johansson, Channing Tatum, George Clooney, Larry David, Charlize Theron, Mark Wahlberg, Kobe Bryant, Steve Carell, Hugh Jackman, Kristen Wiig, Jeff Bridges, Jennifer Garner, Ryan Gosling, Bryan Cranston, Jamie Foxx, Amy Poehler, Ben Affleck, Robert Downey Jr., Jake Gyllenhaal, Oprah, and unfortunately Matt Damon.\n\nPatriots Super Bowl Champ Danny Amendola Doesn\'t Have Time for Nerves\n<a target="_blank" href="https://youtu.be/9L77BLA2qSw">https://youtu.be/9L77BLA2qSw</a>', 'Patriots Super Bowl Champ Danny Amendola Doesn\'t Have Time for Nerves', 'Danny recalls how he felt when his team was down at halftime during the Super Bowl and talks about the Patriots\' upcoming celebratory parade. Mean Tweets - NFL Edition #2 https://youtu.be/1T6J8hg7WFs SUBSCRIBE to get the latest #KIMMEL: http://bit.ly/JKLSubscribe Watch the&hellip;', 'publish', 'open', 'open', '', 'patriots-super-bowl-champ-danny-amendola-doesnt-have-time-for-nerves', '', '', '2017-02-07 11:00:00', '2017-02-07 11:00:00', '', 0, 'http://10.0.2.15/wordpress/index.php/2017/02/07/patriots-super-bowl-champ-danny-amendola-doesnt-have-time-for-nerves/', 0, 'post', '', 0),
